import React, { useEffect, useState } from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';

// When render method called useEffect runs automatically




const App1 = () => {
    const [num, setNum] = useState(0);
    const [nums, setNums] = useState(0);


    useEffect(() => {
        alert("Button clicked");
    },[]);

    return (
        <>
          
            <button
                onClick={() => {
                    setNum(num + 1);
                }
                }
            >
                Click Me {num}
            </button>
            <br />
            <button
                onClick={() => {
                    setNums(nums + 1);
                }
                }
            >
                Click Me {nums}
            </button>
             
      </>
    );
};
export default App1;
